  - name: TEXT4000
    number: '6'
    value: 'Please refer to Miscellaneous Electronic Submission (Form 99) report to
      FEC submitted with this year end report.  This note refers to a Cash On Hand
      Adjustment.  This entry is on line 11(a) as a contribution by Albert Tucker.  The
      cash on hand amount reported in the quarterly reports is off by exactly $240
      when compared to the amount on hand reported for the same time by the bank.  After
      examining the FECfile digital records and two years of the preceeding paper
      records, I am unable to find the error and am now unable to devote any more
      time to this effort.  A good faith effort has been made to reconcile the difference.  Albert
      S Tucker III, Treasurer, VA 6th District Republican Committee (C00005801)

